import React from "react";

import "./footer.styles.css";

const Footer = () => {
  return (
    <div className="footer">
      <div className>
        <div>Columna 1</div>
        <div>Columna 2</div>
        <div>Columna 3</div>
        <div>Columna 4</div>
      </div>
    </div>
  );
};

export default Footer;
